import React from "react";
import { Table } from "react-bootstrap";

const ControlComponentDataTable = (props) => {
  let propsData = props;
  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Password</th>
            <th>Phone</th>
            <th>Message</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {propsData.length >= 1 ? (
           prop
          ) : (
            <tr>
              <td colSpan={6}>No Data Found</td>
            </tr>
          )}
        </tbody>
      </Table>
    </div>
  );
};

export default ControlComponentDataTable;
